sources.CSS\\main.scss:
* {
  padding: 0;
  margin: 0;
  z-index: 1;
  font-family: 'Noto Sans KR', sans-serif;
}

li {
  list-style: none;
}

a {
  text-decoration: none;
  color: #000;
}

/* Header =================================== */

$PointColor: #002053;
$SmallFont : 14px;
$MidleFont : 16px;
$LageFont : 18px;
$TitFont : 32px;

.page {
  position: relative;
  z-index: 5;
  width: 100%;
  height: 100vh;
  box-sizing: border-box;
  font-family: 'Noto Sans KR', sans-serif;
}

.hd_fix {
  position: fixed;
  top: 0;
  left: 0;
  background-color: $PointColor;
  z-index: 99999;
}

.header {
  position: absolute;
  left: 0;
  top: 0;
  z-index: 10;
  width: 100%;
  height: 100px;

  .header_outer{
    width: 100%;
    height: 100px;
  }

  .header_box {
    display: flex;
    width: 1660px;
    height: 100px;
    margin: 0 auto;
    flex-direction: row;
    justify-content: space-between;

    .logo {
      width: 150px;
      height: 100px;
      line-height: 105px;
      text-align: center;
      padding: 10px;
      box-sizing: border-box;
    }

    .sht_header .each_menu_ul,
    .mainMenu .mainMenu_ul {
      width: 400px;
      height: 100px;
      display: flex;
      justify-content: space-between;
      align-items: center;
      font-size: 20px;
      font-weight: bold;

      li:nth-child(4) {
        width: 1px;
        height: 15px;
        border-right: 1px solid #fff;
        box-sizing: border-box;
      }

      li {
        height: 100px;
        line-height: 100px;
      }

      a {
        color: #fff;
        display: block;
      }
    }
  }
}


/* GNB ========== */
.header .gnb {
  .gnb_box {
    .gnb_Menu {
      width: 220px;
      height: 100px;
      display: flex;
      flex-wrap: wrap;
      flex-direction: row;
      justify-content: space-around;
      align-items: center;

      .gnb_Menu_map picture {
        padding: 5px;
        text-align: center;
      }
    }
  }
}



/* 메인 메뉴 SHEET HEADER 영역*/
.mainMenu_Sheet {
  position: absolute;
  top: 0;
  left: 0;
  z-index: 100;
  width: 100%;
  height: 100vh;
  display: flex;
  justify-content: center;
  /* background 블러처리 */
  background-color: rgba(0, 0, 0, 0.1);
  backdrop-filter: blur(8px);

  .main_menu_sht_outer {
    width: 100%;
    height: 65vh;
    background-color: #fff;
    display: flex;
    justify-content: center;

    .main_menu_sht {
      display: flex;
      z-index: 100;
      flex-direction: row;
      flex-wrap: wrap;
      justify-content: center;
      width: 1660px;
      height: 65vh;
      background-color: #fff;
      background-blend-mode: hue;

      /* SHEET 메뉴 영역 */
      .sht_header {
        display: flex;
        width: 1660px;
        height: 100px;
        margin: 0 auto;
        flex-direction: row;
        justify-content: space-between;

        .sht_logo {
          width: 150px;
          height: 100px;
          line-height: 105px;
          text-align: center;
          padding: 10px;
          box-sizing: border-box;
        }

        .each_menu_ul {
          width: 400px;
          height: 100px;
          display: flex;
          justify-content: space-between;
          align-items: center;
          font-size: 20px;
          font-weight: bold;

          li {
            height: 25px;
            line-height: 25px;
          }

          // sheet 메뉴 상단 hover color 변경
          li:hover {
            border-bottom: 2px solid $PointColor;
            box-sizing: border-box;
          }
        }

        .sht_gnb_Menu {
          width: 220px;
          height: 100px;
          display: flex;
          flex-wrap: wrap;
          flex-direction: row;
          justify-content: space-around;
          align-items: center;

          .sht_gnb_Menu_map picture {
            padding: 5px;
            text-align: center;
          }
        }
      }
    }
  }
}


/* SHEET 영역 내 HEADER li(bar) 영역*/
.mainMenu_Sheet {
  .main_menu_sht {
    .sht_header {
      .each_menu_ul {
        li {
          a {
            color: #000;
          }
        }

        li:nth-child(4) {
          position: relative;
          z-index: -1;
          display: block !important;
          width: 1px;
          height: 15px;
          border-right: 1px solid #000;
          box-sizing: border-box;
        }
      }
    }
  }
}



/* SHEET MENU LIST BOX (맨앞,맨뒤영역)*/
.sheet_box {
  width: 1660px;
  position: absolute;
  top: 100px;
  display: flex;

  .sht_firstBox,
  .sht_lastBox {
    display: flex;
    width: 13.3333%;
    height: 500px;
    flex-direction: row;
    flex-wrap: wrap;
    box-sizing: border-box;
    align-content: flex-start;
    padding: 30px 20px;
    box-sizing: border-box;

    li:first-child {
      width: 100%;
      height: 50px;
      line-height: 35px;
      font-weight: bold;
      font-size: $LageFont;
    }

    li:nth-child(6) {
      margin-top: 20px;
    }

    li {
      width: 100%;
      height: 35px;
      line-height: 35px;
    }

    li:hover a {
      color: $PointColor;
      font-weight: bold;
    }

    li:first-child:hover a {
      color: #000;
    }
  }
}




/* SHEET MENU LIST BOX (중간영역)*/
.sht_box_1,
.sht_box_2,
.sht_box_3,
.sht_box_4 {
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
  align-content: flex-start;
  width: 13.3333%;
  height: 500px;
  padding: 30px 25px;
  box-sizing: border-box;


  li:first-child {
    height: 50px;
    font-weight: bold;
    font-size: $LageFont;
  }

  li {
    width: 100%;
    height: 35px;
    line-height: 35px;
  }

  li:hover a {
    color: $PointColor;
    font-weight: bold;
  }

  li:first-child:hover a {
    color: #000;
  }
}



/* SHEET MENU LIST BOX (영역사이 bar)*/
.bar_sht {
  width: 10%;
  height: 390px;
  box-sizing: border-box;
  margin: 40px 0;

  .bar_1:first-child {
    width: 50%;
    height: 100%;
    border-right: 1px solid #ccc;
    box-sizing: border-box;
  }

  .bar_2:first-child {
    width: 50%;
    height: 100%;
    border-right: 1px solid #ccc;
    box-sizing: border-box;
  }
}

.Men_bar_sht_1,
.Men_bar_sht_2 {
  height: 335px;
}

.Kids_bar_sht_1,
.Kids_bar_sht_1 {
  height: 415px;
}




.mainMenu_Sheet {
  display: none;
}

// .Women_sheet_box {display: none;}
// .Men_sheet_box {display: none;}
// .Kids_sheet_box {display: none;} 




/* BRAND BOX */
.Brand_sheet_box {
  background-color: #fff;
  display: flex;

  .Brand_outer {
    width: 20%;
    height: 500px;
    padding: 10px;
    box-sizing: border-box;

    a {
      display: block;

      img {
        width: 100%;
        height: auto;
        display: block;
      }

      p {
        width: 100%;
        height: 30px;
        line-height: 30px;
        text-align: center;
        font-weight: bold;
        padding-top: 15px;
      }
    }
  }
}



/* Visual Main Swiper ======================= */
.swiper_visual {
  width: 100%;
  height: 100vh;
  overflow: hidden;
  /* 전체 Swiper 영역 CSS 수정 */

  .swiper_visual,
  swiper-container {
    position: relative;
    width: 1660px;

    .swiper-wrapper {
      width: 100%;
      height: 100vh;
    }
  }



  /* Swiper-Silde 내용 CSS 수정 */
  .swiper-slide,
  swiper-slide {
    position: relative;
    text-align: center;
    font-size: 70px;
    overflow: hidden;

    img {
      width: 100%;
      min-width: 1660px;
      height: auto;
      display: block;
    }
    .visual_txt {
      position: absolute;
      left: 150px;
      bottom: 210px;
      height: 50px;
      line-height: 50px;
      font-size: 22px;
      text-align: left;

      h1 {
        color: #fff;
        text-shadow: 2.5px 2.5px 5px #000;
      }
    }
    a {
      display: block;

      input {display: none;}
      label {
        position: absolute;
        left: 150px;
        bottom: 142px;
        width: 180px;
        height: 50px;
        line-height: 45px;
        text-align: center;
        background-color: #ccc;
        font-size: 18px;
        color: #fff;
        border-radius: 30px;
        border: 2px solid #fff;
        background-color: rgba(255, 255, 255, 0.1);
        backdrop-filter: blur(2px);
        cursor: pointer;
        box-shadow: 2px 2px 5px #000;
      }
      label:hover {
        background-color: #002053;
        border: 2px solid #002053;
        transition: 0.3s;
      }
    }
  }


  /* Progress Bar 색상 및 CSS 수정 */
  .swiper-horizontal>.swiper-scrollbar,
  .swiper-scrollbar.swiper-scrollbar-horizontal {
    z-index: 1;
    width: 300px;
    height: 25px;
    bottom: 87px;
    left: 150px;
    border-radius: 5px;
    background-color: rgba(255, 255, 255, 0.1);
    box-shadow: 2px 2px 5px;
  }

  /* Progress Bar Drag 색상 및 CSS 수정 */
  .swiper-scrollbar-drag {
    border-radius: 5px;
    background-color: $PointColor;
  }

  /* Arrow Next 위치 변경 */
  .swiper-button-prev,
  .swiper-rtl .swiper-button-next {
    top: auto;
    left: 540px;
    bottom: 75px;
    color: #fff;
    z-index: 1;
  }

  /* Arrow Prev 위치 변경 */
  .swiper-button-next,
  .swiper-rtl .swiper-button-prev {
    top: auto;
    left: 585px;
    bottom: 75px;
    color: #fff;
    z-index: 1;
  }

  .swiper-button-next:after,
  .swiper-button-prev:after {
    z-index: 1;
    font-size: 25px;
    padding: 5px 12px;
    border-radius: 5px;
    font-weight: bold;
    text-shadow: 3px 3px 5px #000;
  }


  /* Progress 옆 pagination CSS 수정 */
  .swiper-pagination-fraction {
    z-index: 1;
    width: 80px;
    height: 35px;
    text-align: center;
    line-height: 30px;
    font-weight: bold;
    left: 455px;
    bottom: 80px;
    top: auto;
    font-size: 25px;
    color: #fff;
    text-shadow: 3px 3px 5px #000;
  }
}




/* Ranking Swiper ======================= */
.Ranking {
  overflow: hidden;

  .Ranking_box {
    position: relative;
    width: 1660px;
    height: 950px;
    margin: 0 auto;
    overflow: hidden;
    border: 1px solid #000;
    box-sizing: border-box;

    // Ranking 타이틀
    .Ranking_title{
      z-index: 10;
      position: absolute;
      top: 80px;
      width: 100%;

      h1 {
        width: 1660px;
        height: 80px;
        line-height: 80px;
        text-align: center;
        font-size: 32px;
      }

      // Ranking TAP
      .Ranking_Tap {
        width: 900px;
        height: 50px;
        line-height: 50px;
        margin: 0 auto;
        display: flex;
        justify-content: space-around;
        background-color: #fff;
        box-shadow: 1px 1px 2px #000;
        border-radius: 10px;
        box-sizing: border-box;

        li {
          width: 120px;
          text-align: center;
          cursor: pointer;
        }
        li:hover {
          font-weight: bold;
          box-sizing: border-box;
        }
      }
    }

    .swiper_Ranking {
      margin-top: 20vh;
      border: 1px solid #000;
      box-sizing: border-box;

      // Swiper 전체페이지
      .swiper-wrapper {
        width: 100%;
      }

      // Swiper 각 페이지
      .swiper-slide {
        width: 100%;
        margin-top: 5vh;
        height: 70vh;
        overflow: hidden;

        img {
          width: 100%;
          display: block;
          height: auto;
        }
      }
  
      .swiper-slide-active {
        z-index: 5;
      }
  
  
      // Pagination List
      .swiper-pagination {
        z-index: 5;
        width: 396px;
        height: 100vh;
        background-color: rgba(255, 255, 255, 1);
        bottom: 0;
        left: 0;
        padding: 300px 20px 5px;
        box-sizing: border-box;
        // border: 1px solid #000;
        border-right: 1px solid #eee;

        .custom_bullet {
          border-radius: 0px;
          width: 350px;
          height: 54px;
          margin-bottom: 5px;
          display: flex;
          border: 1px solid #eee;
          border-radius: 7px;
          box-sizing: border-box;
        }
  
        .custom_bullet span {
          width: 100%;
          line-height: 50px;
          padding-left: 10px;
          box-sizing: border-box;
          font-size: $SmallFont;
          text-align: left;
          letter-spacing: 0.5px;
        }
  
        .swiper-pagination-custom-bullet {
          font-weight: bold;
          background-color: $PointColor;
          box-sizing: border-box;
          color: #fff;
        }
      }


      // Btn Arrow
      .swiper-button-next,
      .swiper-button-prev {
        position: absolute;
        left: auto;
        top: auto;
        right: 250px;
        bottom: 39%;
        color: #000;
        font-weight: bold;
      }

      .swiper-button-prev {
        left: 38%;
        color: #000;
        font-weight: bold;
      }
    }
  }
}



// slide_sub_img --------------------
.slide_sub_img {
  position: relative;
  z-index: -1;
  background-image: url(./BACK_IMG/sus_ban01.jpg);
  background-attachment: fixed;
  background-repeat: no-repeat;
  background-size: cover;
  margin: 10vh 0;
  height: 80vh;
  box-sizing: border-box;
  
  .slide_sub_img_box {
    position: fixed;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
    width: 250px;
  }
  .slide_sub_img_box img {
    width: 100%;
    height: auto;
    display: block;
  }
  
  .slide_sub_txt {
    position: fixed;
    left: 50px;
    top: 150px;
    writing-mode: vertical-rl;
    font-size: 22px;
    color: #fff;
    font-weight: bold;
  }
}





// new_arrival ----------------------
.new_arrival {
  font-size: 70px;
  font-weight: bold;
  text-align: center;
  background-color: antiquewhite;
  border: 1px solid #000;
  box-sizing: border-box;
  overflow: hidden;

  h1{
    width: 300px;
    height: 20vh;
    text-align: center;
    line-height: 20vh;
    margin: 0 auto;
    font-size: $TitFont;
  }

  .new_arrival_box {
    width: 1660px;
    margin: 0 auto;
    
    .NewArrival_Swiper {
      width: 100%;
      height: 70vh;

      border: 1px solid #000;
      box-sizing: border-box;

      .swiper-wrapper {

        .swiper-slide {
          height: 50vh;
          margin-top: 10vh;

          border: 1px solid blue;
          box-sizing: border-box;
        }
        .swiper-slide-active {
          scale: 1.1;
          z-index: 6;
          background-color:burlywood;
        }
      }
    }
  }
}




// magaZine ------------------------
.magaZine {
  font-size: 70px;
  font-weight: bold;
  text-align: center;
  border: 1px solid #000;
  box-sizing: border-box;
  overflow: hidden;

  h1 {
    font-size: $TitFont;
    width: 500px;
    height: 15vh;
    margin: 0 auto;
    line-height: 22vh;
  }

  .magaZine_box {
    width: 1660px;
    height: 100vh;
    margin: 0 auto;

    .Magazine_Swiper {
      height: 100vh;

      .swiper-wrapper {
        .swiper-slide {
          position: relative;
          width: 600px;
          height: 740px;
          cursor: pointer;
