            border-radius: 30px;
            backdrop-filter: blur(3px);
            box-shadow: 1px 1px 3px #000;
            cursor: pointer;
          } 

          .Magazine_blur{
            position: absolute;
            left: 0;
            top: 0;
            width: 100%;
            height: 100%;
            background-color: rgba(0, 0, 0, 0.5);
            backdrop-filter: blur(1px);
            opacity: 0;
            // JAVA MouseOver 애니메이션 삽입
          } 
        }
      }
    }
  }
}



