  .SNS_box {
    position: relative;
    display: flex;
    width: 1660px;
    height: 60vh;
    margin: 0 auto;
    background-color: darkkhaki;
    box-sizing: border-box;
    flex-direction: row;
    flex-wrap: wrap;
    overflow: hidden;
    justify-content: center;

    .SNS_title {
      position: absolute;
      left: 0;
      top: 0;
      width: 100%;
      height: 50px;
      background-color: skyblue;
      font-size: 10px;

      span:first-child {
        width: 100px;
        margin-left: 10px;
        float: left;
      }

      span:nth-child(2) {
        width: 100px;
        margin-right: 10px;
        float: right;
      }
    }

    .SNS_cont {
      width: 20%;
      height: 28vh;
      margin-right: 2%;
      overflow: hidden;

      img {
        width: 100%;
        height: auto;
        display: block;
      }
    }
  }
  /* footer ============ */
  .footer {
    height: 40vh;
    background-color: burlywood;
  }
